import syssys.path.insert(0,'..') # adds parent directoryimport numpy as npimport gmshimport pdeimport scipy.sparse as spsimport scipy.sparse.linalgimport timeimport geometriesimport plotly.io as piopio.renderers.default = 'browser'from matplotlib.pyplot import spynp.set_printoptions(threshold = np.inf)np.set_printoptions(linewidth = np.inf)np.set_printoptions(precision = 8)gmsh.initialize()gmsh.model.add("Capacitor plates")geometries.unitSquare()gmsh.option.setNumber("Mesh.Algorithm", 2)gmsh.option.setNumber("Mesh.MeshSizeMax", 0.7)gmsh.option.setNumber("Mesh.MeshSizeMin", 0.7)# gmsh.fltk.run()p,e,t,q = pde.petq_generate()MESH = pde.mesh(p,e,t,q)MESH.makeFemLists()fig = MESH.pdemesh(info=1)fig.show()p2,e2,t2 = MESH.refinemesh()MESH2 = pde.mesh(p2,e2,t2,q)fig = MESH2.pdemesh(info=1)fig.show()